// get funds from users
//  withdraw funds
// Set a minimum funding value in USD



// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;


interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  function getRoundData(
    uint80 _roundId
  ) external view returns (uint80 roundId, int256 answer, uint256 startedAt, uint256 updatedAt, uint80 answeredInRound);

  function latestRoundData()
    external
    view
    returns (uint80 roundId, int256 answer, uint256 startedAt, uint256 updatedAt, uint80 answeredInRound);
}

contract FundMe{
        // set a minimum value = 5$
        uint256 min_USD = 5;

    function fund() public payable  {
        //allow user to send money
    
        // msg.value :- value to be sent along with message(accepts ETH )
        // 1 e18 = 1 ETH = 1000000000000000000 = 1 * 10^18
        require(msg.value >= min_USD, "Didnt send enough ETH"); // 0.01 ETH = 1e16 wei

        //i.e anybody should send more then 1 ETH or else the transcation will get " revert " the whole with a message and goes into its initial state

    }

    // function Withdraw() public{

    // }

    // function getPrice() public returns (uint256){
    //     //address - 0x694AA1769357215DE4FAC081bf1f309aDC325306
    //     //chainlink ABI
    // }

    // function getConverstionRate() public {

    // }

    function getVersion () public view  returns (uint256){
        return AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306).version();
    }
}

